import React, {Component} from 'react';
import {Redirect} from 'react-router-dom';



class MemberCountFormComponent extends Component {
    constructor(props) {
        super(props);

        this.handleChange = this.handleChange.bind(this);
        this.state = {
            value: "",
            count_senior: "",
            count_middle: "",
            count_junior: ""
        };
    }

    handleChange = (e) => {
        const {name, value} = e.target;
        this.setState({[name] : value});

        let  childFamilyData= { memberCountData :{
            count_senior: this.state.count_senior,
            count_middle: this.state.count_middle,
            count_junior: this.state.count_junior,
        }
        };
        this.props.onSelectedChild(childFamilyData);
    };


    render() {
        return (
            <div>
                 <p><label># People 60+ yrs.</label><input  onChange={this.handleChange} name="count_senior" id="count_senior" type="number" min="0" max="13" /></p>
                 <p><label># People 18 - 59 yrs</label><input  onChange={this.handleChange} name="count_middle" id="count_middle" type="number" min="0" max="13" /></p>
                 <p><label># People birth - 17 yrs.</label><input  onChange={this.handleChange} name="count_junior" id="count_junior" type="number" min="0" max="13" /></p>

            </div>
        )
    }
}
export default MemberCountFormComponent;
